import { Avatar, Button, Grid, Link, Paper, TextField, Typography } from "@mui/material";
import React from "react";

const paperStyle={padding:20, height:'70vh', width:300, margin:'20px auto'};
const avatarStyle={backgroundColor:'#1bbd7e'};
const textStyle={margin:'0px 0px 12px 0px'};

const SignIn=()=>{
  return(
    <Grid>
      <Paper elevation={10} style={paperStyle}>
        <Grid align='center'>
          <Avatar style={avatarStyle}>S</Avatar>
          <h2>Sign In</h2>
        </Grid>
        <TextField label="Username" placeholder="Enter Username" fullWidth='true' required style={textStyle}/>
        <TextField label="Password" placeholder="Enter Password" type="password" fullWidth='true' required style={textStyle}/>
        <Button type="submit" color="primary" variant="contained" fullWidth>Sign In</Button>
        <Typography>
          <Link href="#">
            Link
          </Link>
        </Typography>
      </Paper>
    </Grid>
  );
}


